import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'teste-iot';
}
<nav>
  <a routerLink="/login">Login</a>
  <a routerLink="/devices">Listagem de Dispositivos</a>
  <a routerLink="/register-device">Registrar Dispositivo</a>
</nav>

<router-outlet></router-outlet> <!-- Onde os componentes da rota serão renderizados -->
